import React from 'react';

const HomePage = () => {
  const apiMethods = [
    { method: "Current Weather", endpoint: "/current.json or /current.xml" },
    { method: "Forecast", endpoint: "/forecast.json or /forecast.xml" },
    { method: "Search or Autocomplete", endpoint: "/search.json or /search.xml" },
    { method: "History", endpoint: "/history.json or /history.xml" },
    { method: "Alerts", endpoint: "/alerts.json or /alerts.xml" },
    { method: "Marine", endpoint: "/marine.json or /marine.xml" },
    { method: "Future", endpoint: "/future.json or /future.xml" },
    { method: "Time Zone", endpoint: "/timezone.json or /timezone.xml" },
    { method: "Sports", endpoint: "/sports.json or /sports.xml" },
    { method: "Astronomy", endpoint: "/astronomy.json or /astronomy.xml" }
  ];

  return (
    <div className="home-page">
      <h1>Welcome to the Weather App</h1>

      <section>
        <h2>Available API Methods</h2>
        <ul>
          {apiMethods.map((api, index) => (
            <li key={index}>
              <strong>{api.method}:</strong> {api.endpoint}
            </li>
          ))}
        </ul>
      </section>
    </div>
  );
};

export default HomePage;
